import { Alert, Snackbar, Typography } from "@mui/material"

function SnackBar() {
  return (
    <>
    <Typography variant='h4' sx={{margin:'10px', textAlign:'center'}}>snackbar alert type message</Typography>

    <Snackbar>
        <Alert/>
    </Snackbar>


    </>
  )
}

export default SnackBar
